// function to check if a sentence contains at least one occurrence of each letter in the alphabet
function f_gold(sentence) {
    var res = 0;
    for (var c of sentence) {
        // set the bit corresponding to the letter in the result variable
        res |= 1 << (c.charCodeAt(0) - 'a'.charCodeAt(0));
        // if all bits are set, return true
        if (res == 0x3FFFFFF) {
            return true;
        }
    }
    // if all bits are not set, return false
    return false;
}
```
